import React from 'react';

const navBarStyles = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    backgroundColor: '#333',
    padding: '10px 20px'
};

const logoStyles = {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '1.5em',
    fontWeight: 'bold'
};

const linksListStyles = {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0
};

const linkItemStyles = {
    marginLeft: '20px'
};

const linkStyles = {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '1em'
};

const linkHoverStyles = {
    textDecoration: 'underline'
};

const NavBar = () => {
    return (
        <nav style={navBarStyles}>
            <div className="navbar-logo">
                <a href="/" style={logoStyles}>My Watch Project</a>
            </div>
            <ul style={linksListStyles}>
                <li style={linkItemStyles}><a href="/" style={linkStyles}>Home</a></li>
                <li style={linkItemStyles}><a href="/sales" style={linkStyles}>Sales</a></li>
                <li style={linkItemStyles}><a href="/research" style={linkStyles}>Research</a></li>
                <li style={linkItemStyles}><a href="/about" style={linkStyles}>About</a></li>
            </ul>
        </nav>
    );
};

export default NavBar;
